import { Component } from "react";

class Card extends Component {
  render() {
    return (
      <div className="card">
        <div className="card-container" key={this.props.id}>
          <img
            alt={`host ${this.props.name}`}
            src={`https://cdn-icons-png.flaticon.com/512/915/915974.png?w=60`}
            width={70}
          />
          <h2>{this.props.name}</h2>
          <p>{this.props.email}</p>
        </div>
      </div>
    );
  }
}

export default Card;
